// Accueil.js
import React from 'react';
import '../Style/Accueil.css';
import Navbar from './Navbar';
import Tapbar from './Tapbar';

function Accueil() {
    return (
        <>
            <Navbar />
            <div className="rectangle">
                <div className="texte-sur-image">Florian Armengaud</div>
            </div>
            <Tapbar />
        </>
    );
}

export default Accueil;
